import React, { FunctionComponent } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import Header from './components/Header/Header';
import AllRecipesPage from './containers/AllRecipesPage/AllRecipesPage';
import FavouriteRecipesPage from './containers/FavouriteRecipesPage/FavouriteRecipesPage';
import HomePage from './containers/HomePage/HomePage';
import ProfilePage from './containers/ProfilePage/ProfilePage';
import { RoutePaths } from './routes/routePaths';

// const HomePage = React.lazy(() => import('./containers/HomePage/HomePage'));
// const ProfilePage = React.lazy(() => import('./containers/ProfilePage/ProfilePage'));
// const AllRecipesPage = React.lazy(() => import('./containers/AllRecipesPage/AllRecipesPage'));
// const FavouriteRecipesPage = React.lazy(() => import('./containers/FavouriteRecipesPage/FavouriteRecipesPage'));

const App: FunctionComponent = () => {
  return (
    <div className="App">
      {/* <Header /> */}
       <nav>
        <ul>
          <li><Link style={{ width: '60%' }} to={RoutePaths.HOME}>HGR</Link></li>
          <li><Link style={{ width: '20%' }} to={RoutePaths.PROFILE}>profile</Link></li>
          <li><Link style={{ width: '20%' }} to={RoutePaths.FAVOURITE_RECIPES}>favourite recipes</Link></li>
          <li><Link style={{ width: '20%' }} to={RoutePaths.ALL_RECIPES}>all recipes</Link></li>
        </ul>
      </nav>

      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path={RoutePaths.PROFILE} element={<ProfilePage />} />
        <Route path={RoutePaths.FAVOURITE_RECIPES} element={<FavouriteRecipesPage />} />
        <Route path={RoutePaths.ALL_RECIPES} element={<AllRecipesPage />} />
        <Route path="*" element={<HomePage />} />
      </Routes>
    </div>
  );
}

export default App;
